A:

You can use a hash table to store the sum of all elements.
Then, for each element, check if the difference between the sum and the current element is in the hash table.
If it is, then you have found a nice index.
Here is some Python code that implements this algorithm:
def find_nice_indices(a):
    s = sum(a)
    seen = set()
    nice_indices = []
    for i, x in enumerate(a):
        if s - x in seen:
            nice_indices.append(i)
        seen.add(x)
    return nice_indices

a = [8, 3, 5, 2]
print(find_nice_indices(a))  # [1, 4]

