#include <iostream>
#include <vector>
#include <unordered_map>

using namespace std;

int main() {
    int n;
    cin >> n;
    vector<int> a(n);
    for (int i = 0; i < n; i++) {
        cin >> a[i];
    }
    unordered_map<int, int> m;
    int sum = 0;
    for (int i = 0; i < n; i++) {
        sum += a[i];
        m[sum - a[i]]++;
    }
    int count = 0;
    for (auto it = m.begin(); it != m.end(); it++) {
        if (it->second > 1) {
            count += it->second;
        }
    }
    cout << count << endl;
    return 0;
}

