    for (int i = 0; i < n; i++) {
        cin >> a[i];
    }
    sort(a.begin(), a.end());
    int left = 0, right = n - 1;
    int count = 0;
    while (left <= right) {
        if (a[left] <= k && a[right] <= k) {
            count++;
            left++;
            right--;
        } else if (a[left] > k) {
            right--;
        } else {
            left++;
        }
    }
    cout << count << endl;
    return 0;
}
