A:

The problem is that you are not considering the case when you are at the last row or column.
For example, if you are at (n-1, n-1) and you want to reach (n, n), you can reach it in two moves:

Move to (n, n-1)
Move to (n, n)

So, you need to add the following condition to your code:
if (x + 1 < n && y + 1 < n) {
    q.push({x + 1, y + 1});
}

A:

You can use a BFS approach to solve this problem.

Initialize a queue with the starting point (1,1)
Initialize a set to keep track of visited points
Initialize a counter to keep track of the number of moves

While the queue is not empty:

Pop the first point from the queue
If the point is the target point, return the counter
If the point is not visited, add it to the visited set
Add the points (x+1,y) and (x,y+1) to the queue
Increment the counter

If the queue is empty and the target point is not found, return -1

Here is the code:
#include <iostream>
#include <queue>
#include <vector>
#include <set>

using namespace std;

int main() {
    int n;
    cin >> n;
    vector<vector<int>> v(n, vector<int>(n));
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            v[i][j] = i * j;
        }
    }
    queue<pair<int, int>> q;
    q.push({1, 1});
    set<pair<int, int>> visited;
    int count = 0;
    while (!q.empty()) {
        int x = q.front().first;
        int y = q.front().second;
        q.pop();
        if (v[x][y] == n) {
            cout << count << endl;
            return 0;
        }
        if (x + 1 < n && y + 1 < n && !visited.count({x + 1, y + 1})) {
            q.push({x + 1, y + 1});
        }
        if (x + 1 < n && !visited.count({x + 1, y})) {
            q.push({x + 1, y});
        }
        if (y + 1 < n && !visited.count({x, y + 1})) {
            q.push({x, y + 1});
        }
        count++;
    }
    cout << -1 << endl;
    return 0;
}

