        if (a[0] % i == 0) {
            count++;
            if (i != a[0] / i) {
                count++;
            }
        }
    }
    for (int i = 1; i < n; i++) {
        count = 0;
        for (int j = 1; j <= sqrt(a[i]); j++) {
            if (a[i] % j == 0) {
                count++;
                if (j != a[i] / j) {
                    count++;
                }
            }
        }
        count--;
        if (count == 0) {
            count = 1;
        }
    }
    printf("%d\n", count);
    return 0;
}
