We can calculate f(i, j) as follows:

If i == j, then f(i, j) = 0.
If arr[i] == 1, then f(i, j) = f(i + 1, j).
If arr[i] == 0, then f(i, j) = min(f(i + 1, j), f(i, j - 1)).

The answer is f(0, n - 1).

