If the difference between the target coordinate and the current coordinate is less than the difference between the target coordinate and the current coordinate minus the current distance, update max to the difference between the target coordinate and the current coordinate minus the current distance.
Repeat steps 2 and 3 until the current distance is equal to the target distance.

