import sys

def max_diff(n, m):
    a = [0] * n
    a[0] = m
    for i in range(1, n):
        a[i] = a[i-1] - 1
        if a[i] < 0:
            a[i] = 0
    return sum(abs(a[i] - a[i+1]) for i in range(n-1))

