        int[] arr = new int[n];
        for (int i = 0; i < n; i++) {
            arr[i] = sc.nextInt();
        }
        int min = arr[0];
        for (int i = 1; i < n; i++) {
            if (arr[i] < min) {
                min = arr[i];
            }
        }
        int sum = 0;
        for (int i = 0; i < n; i++) {
            sum += arr[i];
        }
        int max = sum - min;
        System.out.println(max);
    }
}

A:

You can solve this problem in O(n) time and O(1) space.

Initialize the sum of all the health to sum = 0.
Initialize the minimum health to min = arr[0].

Now, iterate through the array and for each element, add it to sum.

Now, iterate through the array again and for each element, subtract it from min.

Now, the final minimum health is sum - min.

Here is the code:
import java.io.*;
import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int[] arr = new int[n];
        for (int i = 0; i < n; i++) {
            arr[i] = sc.nextInt();
        }
        int sum = 0;
        int min = arr[0];
        for (int i = 0; i < n; i++) {
            sum += arr[i];
        }
        for (int i = 0; i < n; i++) {
            min -= arr[i];
        }
        System.out.println(sum - min);
    }
}

