import java.io.*;
import java.util.*;

public class Solution {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int m = sc.nextInt();
        int k = sc.nextInt();
        int[][] a = new int[n][m];
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < m; j++) {
                a[i][j] = sc.nextInt();
            }
        }
        int count = 0;
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < m; j++) {
                if (i == 0 && j == 0) {
                    continue;
                }
                if (i == 0) {
                    if (a[i][j] == k) {
                        count++;
                    }
                } else if (j == 0) {
                    if (a[i][j] == k) {
                        count++;
                    }
                } else {
                    if (a[i][j] == k) {
                        count++;
                    }
                    if (a[i - 1][j] == k ^ a[i][j]) {
                        count++;
                    }
                    if (a[i][j - 1] == k ^ a[i][j]) {
                        count++;
                    }
                }
            }
        }
        System.out.println(count);
    }
}
