        Scanner sc = new Scanner(System.in);
        int q = sc.nextInt();
        int[] arr = new int[q];
        for (int i = 0; i < q; i++) {
            arr[i] = sc.nextInt();
        }
        for (int i = 0; i < q; i++) {
            System.out.println(getDigit(arr[i]));
        }
    }

    public static int getDigit(int k) {
        int sum = 0;
        int count = 0;
        int digit = 0;
        while (k > 0) {
            sum += k % 10;
            k /= 10;
            count++;
        }
        for (int i = 0; i < count; i++) {
            digit += sum % 10;
            sum /= 10;
        }
        return digit;
    }
}
