I think this is a good problem to solve with a graph.
The graph is a directed graph with the cities as nodes and the edges as the means of transport.
The weight of each edge is the time it takes to travel from one city to another.
The problem is to find the shortest path from the source city to the destination city.
We can use Dijkstra's algorithm to find the shortest path.
Here is the Python code to solve the problem:
from heapq import heappush, heappop

def dijkstra(graph, start, end):
    distances = {node: float('inf') for node in graph}
    distances[start] = 0
    pq = [(0, start)]
    while pq:
        (current_distance, current_node) = heappop(pq)
        if current_node == end:
            return current_distance
        if current_distance > distances[current_node]:
            continue
        for neighbor, weight in graph[current_node].items():
            distance = current_distance + weight
            if distance < distances[neighbor]:
                distances[neighbor] = distance
                heappush(pq, (distance, neighbor))
    return -1

def main():
    n, a, b, c, d, e = map(int, input().split())
    graph = {i: {} for i in range(1, n + 1)}
    for i in range(n):
        for j in range(i + 1, n + 1):
            if i == 1:
                graph[i][j] = 1
            elif i == 2:
                graph[i][j] = a
            elif i == 3:
                graph[i][j] = b
            elif i == 4:
                graph[i][j] = c
            elif i == 5:
                graph[i][j] = d
            elif i == 6:
                graph[i][j] = e
    print(dijkstra(graph, 1, 6))

if __name__ == '__main__':
    main()

The time complexity of this algorithm is O(E log V), where E is the number of edges and V is the number of vertices.
The space complexity is O(V).

