I think you can solve this problem in O(NlogN) time.
First, sort the IDs.
Then, for each ID, check if it is the first or last ID. If it is, then it can pass all the gates.
Otherwise, check if the ID is greater than the previous ID and less than the next ID. If it is, then it can pass all the gates.
