        cin >> l >> r;
        cards.push_back(l);
        cards.push_back(r);
    }
    sort(cards.begin(), cards.end());
    int count = 0;
    for (int i = 0; i < n; i++) {
        if (cards[i] == 1) {
            count++;
        }
        else if (i == 0) {
            count++;
        }
        else if (cards[i] > cards[i - 1] && cards[i] < cards[i + 1]) {
            count++;
        }
    }
    cout << count << endl;
    return 0;
}

