            while (j < n && v[j] % 2 == 0) {
                j++;
            }
            if (j == n) {
                i++;
            } else {
                int k = j;
                while (k < n && v[k] % 2 == 0) {
                    k++;
                }
                int tmp = v[i];
                v[i] = v[j];
                v[j] = tmp;
                i = j;
            }
        }
    }
