                for (int l = 1; l <= k; l++) {
                    sum += gcd(i, j, l);
                }
            }
        }
        System.out.println(sum);
    }

    public static int gcd(int a, int b, int c) {
        if (b == 0) {
            return a;
        }
        return gcd(b, c % b);
    }
}

