You can use a stack to keep track of the indices of the squares you can move to.

Initialize the stack with the first square.
While the stack is not empty, pop the top index from the stack.
If the height of the square at the popped index is greater than the height of the square at the top of the stack, push the popped index back onto the stack.
Otherwise, increment the count of moves.

The time complexity of this algorithm is O(n), where n is the number of squares.
Here's some sample code:
#include <iostream>
#include <vector>

int main() {
    int n;
    std::cin >> n;
    std::vector<int> heights(n);
    for (int i = 0; i < n; i++) {
        int h;
        std::cin >> h;
        heights[i] = h;
    }
    int count = 0;
    std::stack<int> stack;
    stack.push(0);
    while (!stack.empty()) {
        int top = stack.top();
        stack.pop();
        if (top + 1 < n && heights[top + 1] <= heights[top]) {
            stack.push(top + 1);
        } else {
            count++;
        }
    }
    std::cout << count << std::endl;
    return 0;
}

