using namespace std;

int main() {
    int n;
    cin >> n;
    vector<int> heights;
    for (int i = 0; i < n; i++) {
        int h;
        cin >> h;
        heights.push_back(h);
    }
    sort(heights.begin(), heights.end());
    for (int i = 0; i < n; i++) {
        if (heights[i] < heights[i + 1]) {
            heights[i + 1] = heights[i] + 1;
        }
    }
    for (int i = 0; i < n; i++) {
        if (heights[i] < heights[i + 1]) {
            cout << "No" << endl;
            return 0;
        }
    }
    cout << "Yes" << endl;
    return 0;
}

A:

You can use a stack to keep track of the heights.

If the current height is greater than the top of the stack, then you can decrease the height of the top of the stack by 1.
If the current height is less than or equal to the top of the stack, then you can pop the top of the stack.

If the stack is empty at the end, then the heights are non-decreasing.

Here's some code:
#include <iostream>
#include <stack>

int main() {
    int n;
    std::cin >> n;
    std::stack<int> heights;
    for (int i = 0; i < n; i++) {
        int h;
        std::cin >> h;
        heights.push(h);
    }
    for (int i = 0; i < n; i++) {
        if (heights.top() > h) {
            heights.pop();
            heights.push(h - 1);
        } else {
            if (!heights.empty()) {
                heights.pop();
            }
        }
    }
    if (!heights.empty()) {
        std::cout << "No" << std::endl;
    } else {
        std::cout << "Yes" << std::endl;
    }
    return 0;
}

