I think you can solve this problem using dynamic programming.
Let dp[i][j] be the maximum number of monsters that can be defeated by heroes i and j.
Then dp[i][j] = max(dp[i][j], dp[i][k] + dp[k][j]) for all k < i < j.
The base case is dp[i][i] = 0 and dp[i][j] = 0 for all i != j.
The time complexity is O(n^3).
Here is the code:
#include <iostream>
#include <vector>
#include <algorithm>

using namespace std;

int main() {
    int n;
    cin >> n;
    vector<int> a(n+1);
    vector<int> b(n+1);
    for (int i = 1; i <= n; i++) {
        cin >> a[i];
        cin >> b[i];
    }
    vector<vector<int>> dp(n+1, vector<int>(n+1, 0));
    for (int i = 1; i <= n; i++) {
        dp[i][i] = 0;
    }
    for (int i = 1; i <= n; i++) {
        for (int j = i+1; j <= n; j++) {
            dp[i][j] = 0;
        }
    }
    for (int i = 1; i <= n; i++) {
        for (int j = i+1; j <= n; j++) {
            for (int k = i; k <= j; k++) {
                dp[i][j] = max(dp[i][j], dp[i][k] + dp[k][j]);
            }
        }
    }
    cout << dp[1][n] << endl;
    return 0;
}

