The problem is that you are not considering the case where the weights are all equal.
For example, if you have 3 weights, 1, 2, and 3, and T = 2, then the minimum absolute difference is 0, because you can split the weights into two groups of 1 and 2, and the absolute difference of their sums is 0.
However, your code will not consider this case, because it will always try to split the weights into two groups, even if one group has all the weights and the other group has none.
To fix this, you need to add a check at the beginning of your code to see if the weights are all equal. If they are, then the minimum absolute difference is 0, and you can return 0 immediately.
Here is the modified code:
