You can use the Euclidean algorithm to find the greatest common divisor of two numbers.
The Euclidean algorithm works by repeatedly subtracting the smaller number from the larger number until the two numbers are equal. The greatest common divisor is then the value of the two equal numbers.
Here is an example implementation of the Euclidean algorithm in Python:
def gcd(a, b):
    while b:
        a, b = b, a % b
    return a

You can use this function to find the greatest common divisor of all the numbers in the list.
Here is an example implementation of the algorithm in Python:
def gcd_list(numbers):
    result = numbers[0]
    for number in numbers[1:]:
        result = gcd(result, number)
    return result

You can then use this function to find the greatest common divisor of the numbers in the list.
Here is an example implementation of the function in Python:
def gcd_list(numbers):
    result = numbers[0]
    for number in numbers[1:]:
        result = gcd(result, number)
    return result

numbers = [7, 6, 8]
result = gcd_list(numbers)
print(result)

This will output 2, which is the greatest common divisor of the numbers in the list.

