You can use the following approach:

Find the prime factors of 2019.
For each prime factor, find the number of times it occurs in the range [L, R].
For each prime factor, find the number of times it occurs in the range [1, R].
For each prime factor, find the number of times it occurs in the range [1, L].
For each prime factor, find the number of times it occurs in the range [L, R].
For each prime factor, find the number of times it occurs in the range [1, R] * [1, L].
For each prime factor, find the number of times it occurs in the range [L, R] * [1, L].

The final answer is the minimum of all the above values.
