import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int L = sc.nextInt();
        int R = sc.nextInt();
        int ans = Integer.MAX_VALUE;
        int[] factors = new int[2019];
        for (int i = 2; i <= 2019; i++) {
            while (2019 % i == 0) {
                factors[i - 1]++;
                2019 /= i;
            }
        }
        for (int i = 0; i < factors.length; i++) {
            int count1 = 0;
            int count2 = 0;
            int count3 = 0;
            int count4 = 0;
            int count5 = 0;
            int count6 = 0;
            int count7 = 0;
            int count8 = 0;
            for (int j = 1; j <= R; j++) {
                if (j <= L) {
                    count1++;
                } else {
                    count2++;
                }
            }
            for (int j = 1; j <= L; j++) {
                if (j <= R) {
                    count3++;
                } else {
                    count4++;
                }
            }
            for (int j = 1; j <= R; j++) {
                if (j <= L) {
                    count5++;
                } else {
                    count6++;
                }
            }
            for (int j = 1; j <= L; j++) {
                if (j <= R) {
                    count7++;
                } else {
                    count8++;
                }
            }
            ans = Math.min(ans, factors[i] * count1 * count2 * count3 * count4 * count5 * count6 * count7 * count8);
