You can use dynamic programming to solve this problem.
Let dp[i][j] be the maximum sum of cards you can get if you pick up i cards and the sum of the numbers on the cards is j.
Then dp[i][j] = max(dp[i-1][j], dp[i-1][j-1] + 1) if the i-th card has number 1, and dp[i][j] = dp[i-1][j] if the i-th card has number 0.
The answer is dp[A][K].
Here is the code:
#include <stdio.h>

int main() {
    int a, b, c, k;
    scanf("%d %d %d %d", &a, &b, &c, &k);
    int dp[a+1][k+1];
    dp[0][0] = 0;
    for (int i = 1; i <= a; i++) {
