import java.util.Arrays;
import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int k = sc.nextInt();
        int x = sc.nextInt();
        int[] stones = new int[1000000];
        for (int i = 0; i < stones.length; i++) {
            stones[i] = sc.nextInt();
        }
        Arrays.sort(stones);
        int firstBlack = -1;
        int lastBlack = -1;
        for (int i = 0; i < stones.length; i++) {
            if (stones[i] == 1) {
                if (firstBlack == -1) {
                    firstBlack = i;
                } else {
                    lastBlack = i;
                }
            }
        }
        int[] result = new int[k];
        for (int i = 0; i < k; i++) {
            result[i] = firstBlack + i;
        }
        for (int i = 0; i < k; i++) {
            result[i] = lastBlack - i;
        }
        for (int i = 0; i < result.length; i++) {
            System.out.print(result[i] + " ");
        }
    }
}

