import java.io.*;
import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int[] v = new int[n];
        int[] c = new int[n];
        for (int i = 0; i < n; i++) {
            v[i] = sc.nextInt();
            c[i] = sc.nextInt();
        }
        int max = 0;
        for (int i = 0; i < n; i++) {
            int x = 0;
            for (int j = 0; j < n; j++) {
                if (i != j) {
                    x += v[j];
                }
            }
            int y = 0;
            for (int j = 0; j < n; j++) {
                if (i != j) {
                    y += c[j];
                }
            }
            max = Math.max(max, x - y);
        }
        System.out.println(max);
    }
}

