public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int t = sc.nextInt();
        while(t-->0){
            int n = sc.nextInt();
            int a = sc.nextInt();
            int b = sc.nextInt();
            String s = "";
            for(int i=0;i<n;i++){
                s += (char)('a'+i%26);
            }
            int count = 0;
            for(int i=0;i<n-a+1;i++){
                String sub = s.substring(i,i+a);
                if(sub.length()==a){
                    if(sub.chars().distinct().count()==b){
                        count++;
                    }
                }
            }
            if(count==n-a+1){
                System.out.println(s);
            }
        }
    }
}

