A:

You can use std::partition to partition the array into two parts:

The first part contains all elements that are less than 3.
The second part contains all elements that are greater than or equal to 3.

Then, you can count the number of elements in the second part.
Here's an example implementation:
#include <iostream>
#include <vector>
#include <algorithm>

int main() {
    int n;
    std::cin >> n;
    std::vector<int> v(n);
    for (int i = 0; i < n; i++) {
        std::cin >> v[i];
    }
    std::partition(v.begin(), v.end(), [](int x) { return x < 3; });
    std::cout << v.size() - std::distance(v.begin(), std::partition(v.begin(), v.end(), [](int x) { return x >= 3; })) << std::endl;
    return 0;
}

