    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        String s = sc.next();
        String t = "";
        for (int i = 0; i < n; i++) {
            t += s.charAt(i);
        }
        if (s.equals(t)) {
            System.out.println("Yes");
        } else {
            System.out.println("No");
        }
    }
}

A:

You can use a sliding window approach.

Create a window of size n/2.
Check if the window is equal to the string.
If it is, then the string is a concatenation of two copies of some string.

If the window is not equal to the string, then move the window to the right by one character.

Here is the code:
