The problem is that you are not taking into account the fact that the string is repeated.
For example, if the string is "bab", the encrypted string is "baabbb".
So, if you have the encrypted string "baabbb", you need to find the first character that is not equal to 'a'.
In this case, it is 'b'.
Then, you need to find the number of times this character appears in the encrypted string.
In this case, it appears twice.
So, you need to subtract 2 from the index of the first character that is not equal to 'a'.
In this case, it is 1.
So, the decrypted string is "bab".
