class Solution:
    def minOperations(self, n, m, edges):
        # Write your code here
        # dp[i][j] = minimum number of operations to unify MST of the graph with n vertices and m edges
        # dp[i][j] = dp[i][j-1] + dp[i-1][j-1] + dp[i-1][j] + dp[i][j-1]
        dp = [[0 for _ in range(m+1)] for _ in range(n+1)]
        for i in range(1, n+1):
            for j in range(1, m+1):
                dp[i][j] = dp[i][j-1] + dp[i-1][j-1] + dp[i-1][j] + dp[i][j-1]
        for i in range(1, n+1):
            for j in range(1, m+1):
                if edges[j-1][0] == i:
                    dp[i][j] = min(dp[i][j], dp[i-1][j-1] + edges[j-1][2] + dp[i][j-1])
                if edges[j-1][1] == i:
                    dp[i][j] = min(dp[i][j], dp[i-1][j] + edges[j-1][2] + dp[i][j-1])
        return dp[n][m]
