def max_problems(a):
    if len(a) == 1:
        return 1

    max_problems = 0
    for i in range(1, len(a)):
        if a[i] == a[i-1]:
            continue

        problems = 1
        for j in range(i, len(a)):
            if a[j] == a[j-1]:
                continue

            problems += 1
            if problems > max_problems:
                max_problems = problems
                break

    return max_problems

