import sys

n, k = map(int, sys.stdin.readline().split())
segments = []
for _ in range(n):
    l, r = map(int, sys.stdin.readline().split())
    segments.append([l, r])

segments.sort()

def find_bad_points(segments):
    bad_points = set()
    for i in range(len(segments)):
        for j in range(i + 1, len(segments)):
            if segments[i][1] >= segments[j][0]:
                bad_points.update(range(segments[i][0], segments[j][1] + 1))
    return bad_points

bad_points = find_bad_points(segments)

def remove_segments(segments, bad_points):
    removed = set()
    for i in range(len(segments)):
        if segments[i][0] in bad_points:
            removed.add(i)
        elif segments[i][1] in bad_points:
            removed.add(i)
    return removed

removed = remove_segments(segments, bad_points)

print(len(removed))
print(*removed)
