import sys

def main():
    n = int(sys.stdin.readline())
    a = list(map(int, sys.stdin.readline().split()))
    a.sort(reverse=True)
    ans = 0
    for i in range(n):
        if a[i] % a[i-1] == 0:
            ans += a[i]
        elif a[i] % a[i-1] == 1:
            ans += a[i]
            break
    print(ans)

if __name__ == '__main__':
    main()
