using namespace std;

int main() {
    int n;
    cin >> n;
    vector<pair<string, int>> v;
    for (int i = 0; i < n; i++) {
        string s;
        int p;
        cin >> s >> p;
        v.push_back(make_pair(s, p));
    }
    sort(v.begin(), v.end(), [](const pair<string, int>& a, const pair<string, int>& b) {
        return a.first < b.first;
    });
    sort(v.begin(), v.end(), [](const pair<string, int>& a, const pair<string, int>& b) {
        return a.second > b.second;
    });
    for (int i = 0; i < n; i++) {
        cout << i + 1 << endl;
    }
    return 0;
}

