A:

The probability of Snuke winning is the sum of the probabilities of winning with each possible score.
The probability of winning with a score of k is the probability of getting k heads in a row, which is (1/2)^k.
The probability of winning with a score of k or higher is the sum of the probabilities of winning with scores of k, k+1, ..., N.
So the probability of winning is:
sum(i=1 to N) (1/2)^i

