def max_sum_alternating_subsequence(a):
    n = len(a)
    dp = [[0] * (n + 1) for _ in range(n + 1)]
    for i in range(1, n + 1):
        for j in range(i, n + 1):
            if i == j:
                dp[i][j] = a[i - 1]
            elif a[i - 1] * a[j - 1] < 0:
                dp[i][j] = max(dp[i - 1][j], dp[i][j - 1]) + a[i - 1]
            else:
                dp[i][j] = max(dp[i - 1][j], dp[i][j - 1])
    return dp[n][n]

