You can use a HashMap to count the number of occurrences of each element.
Then, iterate over the map and count the number of elements that have a count that is not equal to the value of the element.
Here is an example implementation:
import java.util.HashMap;
import java.util.Map;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int[] a = new int[n];
        for (int i = 0; i < n; i++) {
            a[i] = sc.nextInt();
        }
        Map<Integer, Integer> countMap = new HashMap<>();
        for (int i = 0; i < n; i++) {
            Integer count = countMap.get(a[i]);
            if (count == null) {
                count = 0;
            }
            countMap.put(a[i], count + 1);
        }
        int count = 0;
        for (Map.Entry<Integer, Integer> entry : countMap.entrySet()) {
            if (entry.getValue() != entry.getKey()) {
                count++;
            }
        }
        System.out.println(count);
    }
}

