        int q = sc.nextInt();
        for (int i = 0; i < q; i++) {
            int n = sc.nextInt();
            int m = 0;
            int sum = 0;
            while (n > 0) {
                int power = (int) Math.floor(Math.log(n) / Math.log(3));
                int temp = n % 3;
                n = n / 3;
                sum += temp * Math.pow(3, power);
                if (sum > m) {
                    m = sum;
                }
            }
            System.out.println(m);
        }
    }
}
