    def canThreePartsEqualSum(self, A: List[int]) -> bool:

        total = sum(A)
        if total % 3 != 0:
            return False

        target = total // 3

        curr_sum = 0
        count = 0

        for num in A:
            curr_sum += num

            if curr_sum == target:
                curr_sum = 0
                count += 1

        return count == 3
