You can use the modulo operator % to get the remainder of a division.
For example, 10 % 3 = 1, because 10 divided by 3 is 3 with a remainder of 1.
So, to get the number of donuts you can buy, you can do:
int donuts = (x - a) % b;

This will give you the remainder of x - a divided by b, which is the number of donuts you can buy.
To get the amount of money you have left, you can subtract the cost of the donuts from the original amount of money:
int money_left = x - (donuts * b);

Putting it all together, your code would look like this:
#include <stdio.h>

int main()
{
    int x, a, b;
    scanf("%d", &x);
    scanf("%d", &a);
    scanf("%d", &b);
    int donuts = (x - a) % b;
    int money_left = x - (donuts * b);
    printf("%d\n", money_left);
    return 0;
}

