Let dp[i][j] be the maximum number of candies you can collect if you start from (1,1) and end at (i,j).
Then dp[i][j] = max(dp[i-1][j], dp[i][j-1]) + A[i][j]

The base case is dp[1][1] = A[1][1] + A[2][1]

The time complexity is O(n^2).

