I think this is a good approach:

Sort the array
Iterate through the array and check if the sum of the current element and the next element is greater than x. If it is, then subtract x from the sum and increment the counter.

Here is the code:
#include <iostream>
#include <vector>
#include <algorithm>
using namespace std;

int main() {
    int n, x;
    cin >> n >> x;
    vector<int> a(n);
    for (int i = 0; i < n; i++) {
        cin >> a[i];
    }
    sort(a.begin(), a.end());
    int ans = 0;
    for (int i = 0; i < n - 1; i++) {
        if (a[i] + a[i + 1] > x) {
            ans += a[i] + a[i + 1] - x;
            a[i] = x;
            a[i + 1] = x;
        }
    }
    if (a[n - 1] + a[0] > x) {
        ans += a[n - 1] + a[0] - x;
        a[n - 1] = x;
        a[0] = x;
    }
    cout << ans << endl;
    return 0;
}

