        while(t-->0){
            int a = sc.nextInt();
            int b = sc.nextInt();
            int c = sc.nextInt();
            int n = sc.nextInt();
            if(a+b+c==n){
                Arrays.sort(new int[]{a,b,c}, Collections.reverseOrder());
