import sys

def is_intersecting(l1, r1, l2, r2):
    return l1 <= l2 and r1 >= r2

def is_inside(l1, r1, l2, r2):
    return l2 <= l1 and r1 >= r2

def solve(n, segments):
    segments.sort()
    ans = 0
    for i in range(n):
        for j in range(i+1, n):
            if is_intersecting(segments[i][0], segments[i][1], segments[j][0], segments[j][1]):
                break
        else:
            ans += 1
    return ans

for _ in range(int(sys.stdin.readline())):
    n = int(sys.stdin.readline())
    segments = []
    for _ in range(n):
        l, r = map(int, sys.stdin.readline().split())
        segments.append([l, r])
    print(solve(n, segments))
