This is a dynamic programming problem.
Let's say we have a function f(i, k) that returns the minimum number of moves to make the array a[i] divisible by k.
Then we can define f(i, k) as follows:
f(i, k) = min(f(i-1, k), f(i-1, k-a[i]) + 1)

The first part of the expression is the minimum number of moves to make the array a[i-1] divisible by k. The second part of the expression is the minimum number of moves to make the array a[i-1] divisible by k-a[i].
The base case is f(i, k) = 0 when i = 0.
The time complexity of this algorithm is O(n*k).
Here's the Python code:
def f(a, k):
    n = len(a)
    dp = [[float('inf')] * (k+1) for _ in range(n+1)]
    dp[0][0] = 0
    for i in range(1, n+1):
        for j in range(k+1):
            dp[i][j] = min(dp[i-1][j], dp[i-1][j-a[i-1]] + 1)
    return dp[n][k]

