The problem is that you are not considering the case when the kangaroo is at the leftmost position.
For example, if X = 5, the kangaroo can reach the nest in 2 jumps, but your code will return 3.
You can fix this by adding a condition to check if the kangaroo is at the leftmost position and return 0 in that case.
