        int h = sc.nextInt();
        int w = sc.nextInt();
        String[] s = new String[h];
        for (int i = 0; i < h; i++) {
            s[i] = sc.next();
        }
        int[][] grid = new int[h][w];
        for (int i = 0; i < h; i++) {
            for (int j = 0; j < w; j++) {
                grid[i][j] = s[i].charAt(j) == '#' ? 1 : 0;
            }
        }
        int[][] adj = new int[h][w];
        for (int i = 0; i < h; i++) {
            for (int j = 0; j < w; j++) {
                if (grid[i][j] == 0) {
                    int count = 0;
                    for (int k = -1; k <= 1; k++) {
                        for (int l = -1; l <= 1; l++) {
                            if (k == 0 && l == 0) {
                                continue;
                            }
                            if (i + k >= 0 && i + k < h && j + l >= 0 && j + l < w) {
                                count += grid[i + k][j + l];
                            }
                        }
                    }
                    adj[i][j] = count;
                }
            }
        }
        for (int i = 0; i < h; i++) {
            for (int j = 0; j < w; j++) {
                if (s[i].charAt(j) == '.') {
                    s[i] = s[i].replace(".", Integer.toString(adj[i][j]));
                }
            }
        }
        for (int i = 0; i < h; i++) {
            System.out.println(s[i]);
        }
    }
}

