#include <stdio.h>
#include <math.h>

int main()
{
    int x;
    scanf("%d", &x);
    int i;
    int j;
    int max = 0;
    for (i = 1; i <= x; i++)
    {
        for (j = 2; j <= log(x, i); j++)
        {
            if (pow(i, j) <= x)
            {
                if (pow(i, j) > max)
                {
                    max = pow(i, j);
                }
            }
        }
    }
    printf("%d\n", max);
    return 0;
}

