You can use std::find_first_of and std::find_last_of to find the first and last occurrence of A and Z respectively. Then you can use std::distance to find the length of the substring.
#include <iostream>
#include <string>
#include <algorithm>

int main() {
    std::string s;
    std::cin >> s;
    auto first = std::find_first_of(s.begin(), s.end(), 'A');
    auto last = std::find_last_of(s.begin(), s.end(), 'Z');
    if (first == s.end() || last == s.end()) {
        std::cout << 0;
    } else {
        std::cout << std::distance(first, last);
    }
    return 0;
}

