import java.io.*;
import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int[] a = new int[n];
        for (int i = 0; i < n; i++) {
            a[i] = sc.nextInt();
        }
        int sum = 0;
        for (int i = 0; i < n; i++) {
            sum += a[i];
        }
        int[] b = new int[n];
        for (int i = 0; i < n; i++) {
            b[i] = sum - a[i];
        }
        int a_sum = 0;
        int b_sum = 0;
        for (int i = 0; i < n; i++) {
            a_sum += a[i];
            b_sum += b[i];
        }
        System.out.println(a_sum - b_sum);
    }
}

