#include <stdio.h>
#include <stdlib.h>

int main()
{
    int n, a, b;
    scanf("%d %d %d", &n, &a, &b);
    int sum = 0;
    for (int i = 1; i <= n; i++)
    {
        int sum_of_digits = 0;
        while (i > 0)
        {
            sum_of_digits += i % 10;
            i /= 10;
        }
        if (a <= sum_of_digits && sum_of_digits <= b)
            sum += i;
    }
    printf("%d\n", sum);
    return 0;
}

