def solve(n, packages):
    if n == 0:
        return "NO"
    if n == 1:
        return "YES"
    if n == 2:
        return "YES" if packages[0][0] < packages[1][0] else "NO"

    # create a graph
    graph = {}
    for i in range(n):
        graph[(i, 0)] = []
        graph[(i, 0)] = []
    for i in range(n):
        graph[(i, 0)].append((i+1, 0))
        graph[(i, 0)].append((i, 1))

    # find the shortest path
    queue = [(0, 0, "")]
    visited = set()
    while queue:
        curr, x, path = queue.pop(0)
        if curr == n:
            return path
        if (curr, x) in visited:
            continue
        visited.add((curr, x))
        for i in range(2):
            if i == 0:
                next_x = x + 1
            else:
                next_x = x
            if (curr+1, next_x) in graph:
                queue.append((curr+1, next_x, path+"R"))
            if (curr, next_x) in graph:
                queue.append((curr, next_x, path+"U"))
    return "NO"

