I think this is a good approach:

Create a hashmap with key as the number and value as the count of that number.
Iterate through the array and for each number, check if the number is odd or even.
If the number is odd, then add 1 to the count of that number in the hashmap.
If the number is even, then subtract 1 from the count of that number in the hashmap.

If the count of any number is 0, then it means that there is no number with that count in the array.
If the count of any number is odd, then it means that there is at least one number with that count in the array.

