        int t = sc.nextInt();
        while(t-->0){
            int n = sc.nextInt();
            int k = sc.nextInt();
            String s = sc.next();
            int max = 0;
            for(int i=0;i<n;i++){
                int count = 0;
                for(int j=0;j<n;j++){
                    if(s.charAt(j)==s.charAt(i)){
                        count++;
                    }
                }
                if(count==k){
                    max = Math.max(max,n);
                }
            }
            System.out.println(max);
        }
    }
}

