This is a dynamic programming problem.
Let's define a function f(i, k) which returns the number of ways to split the first i elements of the array into k non-empty non-intersecting subsegments such that each subsegment has odd sum.
The base case is f(0, k) = 1, because there is only one way to split the empty array into k non-empty non-intersecting subsegments such that each subsegment has odd sum.
The recursive case is f(i, k) = sum(f(i - 1, j) for j in 1..k) if the sum of the first i elements is odd, and f(i, k) = 0 otherwise.
The time complexity of this algorithm is O(n^2 * k^2), because we have to compute f(i, k) for all i and k.
Here is the Python code:
def f(i, k):
    if i == 0:
        return 1
    if k == 0:
        return 0
    if i % 2 == 1:
        return sum(f(i - 1, j) for j in range(1, k + 1))
    else:
        return 0

def main():
    n, k = map(int, input().split())
    a = list(map(int, input().split()))
    print(f(n, k))

if __name__ == '__main__':
    main()

