import sys

def print_box(H, W, image):
    for i in range(H):
        for j in range(W):
            if i == 0 or i == H - 1 or j == 0 or j == W - 1:
                print('#', end='')
            else:
                print(image[i][j], end='')
        print()

H, W = map(int, sys.stdin.readline().split())
image = [list(sys.stdin.readline().rstrip()) for _ in range(H)]
print_box(H, W, image)
