#include <stdio.h>
#include <stdlib.h>
#include <string.h>

int main()
{
    int a, b, c;
    scanf("%d %d %d", &a, &b, &c);
    int count = 0;
    int i;
    int *colors = malloc(sizeof(int) * 3);
    if (colors == NULL)
    {
        printf("Not enough memory\n");
        exit(1);
    }
    for (i = 0; i < 3; i++)
    {
        if (colors[i] == 0)
        {
            colors[i] = a;
            count++;
        }
        else if (colors[i] != a && colors[i] != b && colors[i] != c)
        {
            colors[i] = a;
            count++;
        }
    }
    printf("%d", count);
    free(colors);
    return 0;
}

