#include <stdio.h>

int main()
{
    int n, k;
    scanf("%d %d", &n, &k);
    int l[n];
    for (int i = 0; i < n; i++)
    {
        scanf("%d", &l[i]);
    }
    int max = 0;
    for (int i = 0; i < n; i++)
    {
        for (int j = i + 1; j < n; j++)
        {
            for (int k = j + 1; k < n; k++)
            {
                if (k - i + 1 == k - j + 1)
                {
                    int sum = l[i] + l[j] + l[k];
                    if (sum > max)
                        max = sum;
                }
            }
        }
    }
    printf("%d\n", max);
    return 0;
}

