You can use dynamic programming to solve this problem.
Let dp[i][j] be the maximum length of the toy that can be made by joining sticks from i to j.
Then dp[i][j] = max(dp[i][j-1], dp[i+1][j-1] + l[i]) for i in [1, j-1] and j in [i+1, N].
The answer is dp[1][N].

