You can use a simple algorithm to count the number of blocks.

Start from the top left corner of the city.
If the current cell is on the border of the city, increment the number of blocks.
Otherwise, move to the next cell in the same row.
If the current cell is on the border of the city, increment the number of blocks.
Otherwise, move to the next cell in the same column.

Repeat the above steps until you reach the bottom right corner of the city.

Here is the Python code that implements the above algorithm:
