    for j in range(m):
        if i == 0 or i == n - 1 or j == 0 or j == m - 1:
            blocks += 1
        else:
            if i == n - 1:
                j += 1
            elif j == m - 1:
                i += 1
            else:
                i += 1
                j += 1
print(blocks)

