def get_input():
    q = int(sys.stdin.readline())
    for i in range(q):
        l1, r1, l2, r2 = map(int, sys.stdin.readline().split())
        yield l1, r1, l2, r2

def get_answer(l1, r1, l2, r2):
    for a in range(l1, r1 + 1):
        for b in range(l2, r2 + 1):
            if a != b:
                yield a, b

def main():
    for l1, r1, l2, r2 in get_input():
        for a, b in get_answer(l1, r1, l2, r2):
            print(a, b)

