The biggest piece of cake is the one that is formed by the intersection of the two cuts.
The area of the intersection is the area of the square minus the area of the two triangles.
The area of the square is n^2.
The area of the triangle is (n-h) * (n-v).
So the area of the intersection is n^2 - (n-h) * (n-v).
The volume of the intersection is the area of the intersection times the thickness of the cake, which is 4.
So the volume of the intersection is 4 * (n^2 - (n-h) * (n-v)).

