bool is_multigram(string word, int index, string root) {
    if (index == word.size()) {
        return true;
    }
    for (int i = 0; i < word.size(); i++) {
        string temp = word.substr(index, i);
        if (temp.size() == root.size()) {
            if (is_multigram(word, index + i, temp)) {
                return true;
            }
        }
    }
    return false;
}

bool is_multigram(string word) {
    for (int i = 0; i < word.size(); i++) {
        string temp = word.substr(0, i);
        if (is_multigram(word, i, temp)) {
            return true;
        }
    }
    return false;
}

int main() {
    string word;
    cin >> word;
    if (is_multigram(word)) {
        cout << word << endl;
    } else {
        cout << -1 << endl;
    }
    return 0;
}

