You can use a recursive function to find the smallest word in a crossword.
The function will take the current position in the crossword, the current word, and the current row and column.
The function will check if the current position is valid (not out of bounds and not blocked) and if the current word is at least 2 characters long.
If the current position is valid and the current word is at least 2 characters long, the function will add the current character to the current word and call itself recursively with the next position in the crossword.
If the current position is not valid or the current word is not at least 2 characters long, the function will return the current word.
Here is an example implementation in Python:
def find_smallest_word(crossword, row, col, word):
    if row < 0 or row >= len(crossword) or col < 0 or col >= len(crossword[0]):
        return word
    if crossword[row][col] == '#':
        return word
    if len(word) >= 2:
        return find_smallest_word(crossword, row + 1, col, word + crossword[row][col])
    return find_smallest_word(crossword, row, col + 1, word)

crossword = [
    'luka',
    'o#a#',
    'kula',
    'i#a#'
]

smallest_word = find_smallest_word(crossword, 0, 0, '')
print(smallest_word)

This will output:
kala

