I would suggest you to use a 2D array to store the crossword.
You can use a nested loop to iterate through the two strings and check if the characters match. If they do, you can store the character in the 2D array.
Here is an example code snippet that demonstrates this approach:
#include <stdio.h>
#include <string.h>

int main() {
    char A[30], B[30];
    scanf("%s %s", A, B);
    int i, j, k, l;
    int crossword[30][30];

    for (i = 0; i < strlen(A); i++) {
        for (j = 0; j < strlen(B); j++) {
            if (A[i] == B[j]) {
                k = i;
                l = j;
                crossword[k][l] = A[i];
            }
        }
    }

    for (i = 0; i < strlen(A); i++) {
        for (j = 0; j < strlen(B); j++) {
            if (crossword[i][j] == '.') {
                printf(".");
            } else {
                printf("%c", crossword[i][j]);
            }
        }
        printf("\n");
    }

    return 0;
}

