int main() {
    int n1, n2;
    cin >> n1 >> n2;
    string s1, s2;
    for (int i = 0; i < n1; i++) {
        cin >> s1[i];
    }
    for (int i = 0; i < n2; i++) {
        cin >> s2[i];
    }
    int t;
    cin >> t;
    vector<string> v1(n1);
    vector<string> v2(n2);
    for (int i = 0; i < n1; i++) {
        v1[i] = s1[i];
    }
    for (int i = 0; i < n2; i++) {
        v2[i] = s2[i];
    }
    // Create a hash table for each row
    unordered_map<string, string> hash1(v1.begin(), v1.end());
    unordered_map<string, string> hash2(v2.begin(), v2.end());
    // Iterate through the hash table and check if the key is in the other hash table
    for (auto it = hash1.begin(); it != hash1.end(); it++) {
        if (hash2.find(it->first) != hash2.end()) {
            // Swap the values
            string temp = it->second;
            it->second = hash2[it->first];
            hash2[it->first] = temp;
        }
    }
    // Print the result
    for (int i = 0; i < n1; i++) {
        cout << v1[i];
    }
    return 0;
}

