using namespace std;

int main() {
    int n;
    cin >> n;
    vector<int> a(n);
    for (int i = 0; i < n; i++) {
        cin >> a[i];
    }
    sort(a.begin(), a.end());
    int max = 0;
    for (int i = 0; i < n; i++) {
        for (int j = i + 1; j < n; j++) {
            for (int k = j + 1; k < n; k++) {
                for (int l = k + 1; l < n; l++) {
                    if (2 * a[i] < a[j] + a[k] + a[l]) {
                        max = max(max, (a[j] + a[k] + a[l]) * (a[k] - a[i]) / 2);
                    }
                }
            }
        }
    }
    cout << max << endl;
    return 0;
}

