    }
    return 0;
}

A:

You can use a simple algorithm to find the GIS.

Start with the first element of the array.
Find the next element that is greater than the current element.
If there is no such element, stop.
If there is such an element, add it to the GIS and continue with the next element.

Here is a C++ implementation:
#include <iostream>
#include <vector>

using namespace std;

vector<int> findGIS(vector<int>& a) {
    vector<int> gis;
    gis.push_back(a[0]);
    for (int i = 1; i < a.size(); i++) {
        int next = a[i];
        for (int j = 0; j < gis.size(); j++) {
            if (next > gis[j]) {
                gis.push_back(next);
                break;
            }
        }
    }
    return gis;
}

int main() {
    vector<int> a = {2, 3, 1, 5, 4, 7, 6};
    vector<int> gis = findGIS(a);
    for (int i = 0; i < gis.size(); i++) {
        cout << gis[i] << " ";
    }
    cout << endl;
    return 0;
}

