You can use a HashMap to count the number of cards with the same rank.
import java.util.HashMap;
import java.util.Map;

public class Poker {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        String[] cards = sc.nextLine().split(" ");
        Map<Character, Integer> rankCount = new HashMap<>();
        for (int i = 0; i < cards.length; i++) {
            char rank = cards[i].charAt(0);
            if (rankCount.containsKey(rank)) {
                rankCount.put(rank, rankCount.get(rank) + 1);
            } else {
                rankCount.put(rank, 1);
            }
        }
        int max = 0;
        for (Map.Entry<Character, Integer> entry : rankCount.entrySet()) {
            if (entry.getValue() > max) {
                max = entry.getValue();
            }
        }
        System.out.println(max);
    }
}

