A:

You can use a greedy algorithm.

Sort the array of weights in ascending order.
Initialize a variable sum to 0.
Iterate over the array of weights.
If the sum of the current weight and the sum of all previous weights is less than or equal to C, add the current weight to the sum.

The maximum number of different fruits you can eat is the number of iterations.

