import sys

def is_valid(board, x, y):
    for i in range(len(board)):
        if board[i] == x or board[i] == y or abs(board[i] - x) == abs(i - y):
            return False
    return True

def solve(n):
    board = [0] * n
    for i in range(n):
        for j in range(n):
            if is_valid(board, i, j):
                board[i] = j
                if len(board) == n:
                    return True
                if solve(n):
                    return True
                board[i] = 0
    return False

n = int(sys.stdin.readline())
if solve(n):
    print("CORRECT")
else:
    print("INCORRECT")
