        int m = sc.nextInt();
        int p = 2;
        while (p * p <= n) {
            if (n % p == 0) {
                n /= p;
            } else {
                p++;
            }
        }
        int q = 2;
        while (q * q <= m) {
            if (m % q == 0) {
                m /= q;
            } else {
                q++;
            }
        }
        if (p == m) {
            System.out.println(p);
        } else {
            System.out.println(p * m);
        }
    }
}

