#include <stdlib.h>

int main() {
    int n;
    scanf("%d", &n);
    while (n--) {
        char c;
        int d;
        int h;
        int m;
        scanf("%c %d %d %d", &c, &d, &h, &m);
        if (c == 'F') {
            m += d;
            if (m >= 60) {
                m -= 60;
                h += 1;
            }
            if (h >= 24) {
                h -= 24;
            }
            printf("%d %d\n", h, m);
        } else {
            m -= d;
            if (m < 0) {
                m += 60;
                h -= 1;
            }
            if (h < 0) {
                h += 24;
            }
            printf("%d %d\n", h, m);
        }
    }
    return 0;
}
