def check_match(word1, word2):
    if len(word1) != len(word2):
        return False
    for i in range(len(word1)):
        if word1[i] != word2[i]:
            return False
    return True

def check_word_pairs(pairs):
    for pair in pairs:
        word1, word2 = pair.split()
        if not check_match(word1, word2):
            return False
    return True

