        if (isValid) {
            for (int i = 0; i < n; i++) {
                if (d[i] > 0 && d[i] < n - 1) {
                    for (int j = 0; j < n; j++) {
                        if (d[j] == i) {
                            for (int k = 0; k < n; k++) {
                                if (d[k] == j) {
                                    if (d[k] != i && d[k] != j) {
                                        if (d[k] > i && d[k] < j) {
                                            isValid = false;
                                            break;
                                        }
                                    }
                                }
                            }
                        }
                    }
                }
            }
        }
        if (isValid) {
            System.out.println("YES");
        } else {
            System.out.println("NO");
        }
    }
}

