A:

The problem is that you are not considering the case where you have to make a diagonal cut.
For example, if you have a chessboard of size 3x3, you can make a cut in the middle of the board, and you will get 6 pieces.
But if you make a diagonal cut, you will get 9 pieces.
So, you need to consider all possible cuts, including diagonal cuts.
Here is a possible solution:

Create a 2D array to represent the chessboard.
For each cell in the array, count the number of pieces that can be created by making a cut in that cell.
The number of pieces that can be created by making a cut in a cell is equal to the number of pieces in the cell plus the maximum number of pieces that can be created by making a cut in any of its neighbors.

Here is the code:
public class Solution {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int[][] arr = new int[n][n];
        for(int i=0;i<n;i++) {
            for(int j=0;j<n;j++) {
                arr[i][j] = sc.nextInt();
            }
        }
        int ans = 0;
        for(int i=0;i<n;i++) {
            for(int j=0;j<n;j++) {
                int pieces = arr[i][j];
                if(i > 0) {
                    pieces += arr[i-1][j];
                }
                if(i < n-1) {
                    pieces += arr[i+1][j];
                }
                if(j > 0) {
                    pieces += arr[i][j-1];
                }
                if(j < n-1) {
                    pieces += arr[i][j+1];
                }
                ans = Math.max(ans, pieces);
            }
        }
        System.out.println(ans);
    }
}

