You can solve this problem using dynamic programming.
Let's say you have a chessboard of size NxN.
You can make a cut at any cell (i,j) and get a number of pieces equal to the number of pieces in that cell plus the maximum number of pieces that can be created by making a cut in any of its neighbors.
So, the number of pieces that can be created by making a cut in a cell (i,j) is equal to arr[i][j] + max(arr[i-1][j], arr[i+1][j], arr[i][j-1], arr[i][j+1]).
Now, you can create a 2D array dp[N][N] to store the maximum number of pieces that can be created by making a cut in each cell.
You can fill the dp array using the following recurrence relation:
dp[i][j] = arr[i][j] + max(dp[i-1][j], dp[i+1][j], dp[i][j-1], dp[i][j+1])

The final answer will be dp[0][0].
Here's the Python code to solve this problem:
def max_pieces(arr):
    N = len(arr)
    dp = [[0] * N for _ in range(N)]
    dp[0][0] = arr[0][0]
    for i in range(1, N):
        dp[i][0] = dp[i-1][0] + arr[i][0]
        dp[0][i] = dp[0][i-1] + arr[0][i]
    for i in range(1, N):
        for j in range(1, N):
            dp[i][j] = arr[i][j] + max(dp[i-1][j], dp[i+1][j], dp[i][j-1], dp[i][j+1])
    return dp[N-1][N-1]

