import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int a = sc.nextInt();
        int[] e = new int[n];
        for (int i = 0; i < n; i++) {
            e[i] = sc.nextInt();
        }
        int[] s = new int[a];
        for (int i = 0; i < a; i++) {
            s[i] = sc.nextInt();
        }
        int[] d = new int[n];
        for (int i = 0; i < n; i++) {
            d[i] = s[i] - e[i];
        }
        PriorityQueue<Integer> pq = new PriorityQueue<>((a, b) -> a - b);
        for (int i = 0; i < n; i++) {
            if (d[i] > 0) {
                pq.add(d[i]);
            }
        }
        int c = 0;
        while (!pq.isEmpty()) {
            int x = pq.poll();
            if (x > 0) {
                c++;
            }
        }
        System.out.println(c);
    }
}

