You can use a HashMap to store the languages as keys and the number of guests speaking that language as values.
Then, iterate through the guests and for each guest, iterate through the HashMap and check if the language of the guest is already in the HashMap. If it is, increment the value of the language by 1. If it's not, add the language to the HashMap with a value of 1.
After iterating through all the guests, iterate through the HashMap and find the language with the highest value. This will be the language spoken by the most guests.
Then, iterate through the HashMap again and for each guest, check if the language of the guest is the same as the language with the highest value. If it is, increment the awkwardness level by the difference between the current guest's position and the position of the guest with the highest value.
Finally, print the awkwardness level.
Here's some sample code:
import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        HashMap<Integer, Integer> languages = new HashMap<>();
        for (int i = 0; i < n; i++) {
            int language = sc.nextInt();
            if (languages.containsKey(language)) {
                languages.put(language, languages.get(language) + 1);
            } else {
                languages.put(language, 1);
            }
        }
        int maxLanguage = 0;
        int maxLanguageCount = 0;
        for (Map.Entry<Integer, Integer> entry : languages.entrySet()) {
            if (entry.getValue() > maxLanguageCount) {
                maxLanguage = entry.getKey();
                maxLanguageCount = entry.getValue();
            }
        }
        int awkwardness = 0;
        for (int i = 0; i < n; i++) {
            int language = sc.nextInt();
            if (language == maxLanguage) {
                awkwardness += i - languages.get(maxLanguage);
            }
        }
        System.out.println(awkwardness);
    }
}

