int main() {
    int r, n;
    scanf("%d %d", &r, &n);
    int *rooms = malloc(r * sizeof(int));
    for (int i = 0; i < n; i++) {
        scanf("%d", &rooms[i]);
    }
    for (int i = 0; i < n; i++) {
        if (rooms[i] == 0) {
            printf("%d\n", i + 1);
            break;
        }
    }
    if (i == n) {
        printf("too late\n");
    }
    free(rooms);
    return 0;
}

