        for (int j = 0; j < c; ++j) {
            cin >> image[i][j];
        }
    }
    int count = 0;
    for (int i = 0; i < r; ++i) {
        for (int j = 0; j < c; ++j) {
            if (image[i][j] == 'L') {
                count++;
                queue<pair<int, int>> q;
                q.push(make_pair(i, j));
                while (!q.empty()) {
                    int x = q.front().first;
                    int y = q.front().second;
                    q.pop();
                    if (x > 0 && image[x - 1][y] == 'L') {
                        image[x - 1][y] = 'W';
                        q.push(make_pair(x - 1, y));
                    }
                    if (x < r - 1 && image[x + 1][y] == 'L') {
                        image[x + 1][y] = 'W';
                        q.push(make_pair(x + 1, y));
                    }
                    if (y > 0 && image[x][y - 1] == 'L') {
                        image[x][y - 1] = 'W';
                        q.push(make_pair(x, y - 1));
                    }
                    if (y < c - 1 && image[x][y + 1] == 'L') {
                        image[x][y + 1] = 'W';
                        q.push(make_pair(x, y + 1));
                    }
                }
            }
        }
    }
    cout << count << endl;
    return 0;
}
