I think you can solve this problem by using dynamic programming.
Let's say you have a function f(i, j, k, l) that returns the largest rectangle that can be formed with the first i steps in the first direction, the first j steps in the second direction, the first k steps in the third direction, and the first l steps in the fourth direction.
Then, you can calculate f(i, j, k, l) by considering the following cases:

If i + j + k + l == a + b + c + d, then the largest rectangle is the product of the four sides of the rectangle formed by the first i steps in the first direction, the first j steps in the second direction, the first k steps in the third direction, and the first l steps in the fourth direction.
If i + j + k + l < a + b + c + d, then the largest rectangle is the maximum of the following cases:

f(i + 1, j, k, l)
f(i, j + 1, k, l)
f(i, j, k + 1, l)
f(i, j, k, l + 1)

If i + j + k + l > a + b + c + d, then the largest rectangle is the minimum of the following cases:

f(i - 1, j, k, l)
f(i, j - 1, k, l)
f(i, j, k - 1, l)
f(i, j, k, l - 1)

The base case is f(0, 0, 0, 0) = 1.
Here's the code:
#include <stdio.h>
#include <stdlib.h>
#include <math.h>

int f(int i, int j, int k, int l) {
    if (i + j + k + l == a + b + c + d) {
        return i * j * k * l;
    }
    if (i + j + k + l < a + b + c + d) {
        int max = 0;
        for (int x = 0; x < a - i; x++) {
            for (int y = 0; y < b - j; y++) {
                for (int z = 0; z < c - k; z++) {
                    for (int w = 0; w < d - l; w++) {
                        max = max(max, f(i + x, j + y, k + z, l + w));
                    }
                }
            }
        }
        return max;
    }
    if (i + j + k + l > a + b + c + d) {
        int min = 0;
        for (int x = 0; x < a - i; x++) {
            for (int y = 0; y < b - j; y++) {
                for (int z = 0; z < c - k; z++) {
                    for (int w = 0; w < d - l; w++) {
                        min = min(min, f(i - x, j - y, k - z, l - w));
                    }
                }
            }
        }
        return min;
    }
    return 1;
}

int main() {
    int a, b, c, d;
    scanf("%d %d %d %d", &a, &b, &c, &d);
    printf("%d\n", f(a, b, c, d));
    return 0;
}

