You can use a recursive function to solve this problem.
The idea is to divide the number by 2 if it is even, and add 1 if it is odd.
Here is the code:
#include <stdio.h>

int min_operations(int a, int b) {
    if (a == b) {
        return 0;
    }
    if (a % 2 == 0) {
        return 1 + min_operations(a / 2, b);
    } else {
        return 1 + min_operations(a + 1, b);
    }
}

int main() {
    int a, b;
    scanf("%d %d", &a, &b);
    printf("%d\n", min_operations(a, b));
    return 0;
}

